PLOT:

JURASSIC PARK I:

Huge advancements in scientific technology have been able to create an island full of living dinosaurs. 
John Hammond has invited four individuals, plus his two grandchildren to join him at Jurassic Park. 
But will everything go to plan? Especially when one of the parks own workers attempt to steal the dinosaurs embryos, 
and have to shut down all the electricity in the process. It's now a race for survival with everyone located all over the island. 

JURASSIC PARK II: 

After a small girl is attacked by a small group of compsognathus, Ian Malcolm discovers that there is a second island full 
of a variety of dinosaurs. Dr. John Hammond decides to send four adventure to monitor the dinosaur's lifestyle before INGEN move forward in controlling the island. 
Ian Malcolm doesn't like the idea and wants to contact the other three members, but before he can contact them, he finds out that his girlfriend, Sarah Harding is already on the island. 
Now, what was supposed to be a natural viewing of the incredible creatures in their habitats, has turned into a rescue mission with everyones life at danger.

JURASSIC PARK III:

Dr. Alan Grant is now a happy man with the previous incidents of Jurassic Park now behind him. 
Grant is that happy that he announce in public, that nothing on Earth can persuade him back onto the islands. Maybe nothing, except Paul Kirby. 
Kirby and his wife, Amanda want a plane to fly them over Isla Sorna, with Dr. Grant as their guide. But not everything Kirby says is true. When the plane lands, 
Dr. Grant realizes that there is another reason why they are there, that he doesn't know of. Now, Dr. Grant is stuck on an island he has never been on before, 

